// DEV: Should this be refactored to a seperate folder at the same level with "substring" and "airdrop" called "chacha20" ?

mod utils;
mod test_vectors;

global BLOCK_SIZE: u32 = 64; // In bytes.
global STATE_SIZE: u32 = 16; // Each word is 4 bytes long.
global DOUBLE_ROUNDS: u8 = 10;

global MAX: u32 = 160;

// Constants for "expand 32-byte k".
global SIGMA_0: u32 = 0x61707865;
global SIGMA_1: u32 = 0x3320646e;
global SIGMA_2: u32 = 0x79622d32;
global SIGMA_3: u32 = 0x6b206574;

pub struct ChaCha20 {
    state: [u32; 16],
    key: &mut [u32; 8],
    ctr: u32,
    nonce: &mut [u32; 3],
}

impl ChaCha20 {
    pub fn new(key: &mut [u32; 8], ctr: u32, nonce: &mut [u32; 3]) -> Self {
        let state = [
            SIGMA_0, SIGMA_1, SIGMA_2, SIGMA_3, key[0], key[1], key[2], key[3], key[4], key[5],
            key[6], key[7], ctr, nonce[0], nonce[1], nonce[2],
        ];

        ChaCha20 { state, key, ctr, nonce }
    }

    pub fn encrypt<let MAX_CIRCUIT_LEN: u32>(
        self,
        plaintext: BoundedVec<u8, MAX_CIRCUIT_LEN>,
    ) -> BoundedVec<u8, MAX_CIRCUIT_LEN> {
        // plaintext should not be padded because the code below
        // assumes that plaintext.len() != plaintext.max_len()

        let mut out: BoundedVec<u8, MAX_CIRCUIT_LEN> = BoundedVec::new();

        let full_blocks_max = MAX_CIRCUIT_LEN / BLOCK_SIZE;

        for i in 0..full_blocks_max {
            let key_stream = self.block(self.ctr + i);
            let block_start = i * BLOCK_SIZE;

            for j in 0..BLOCK_SIZE {
                let indice_plain = block_start + j;
                out.push(plaintext.get_unchecked(indice_plain) ^ key_stream[j]);
            }
        }

        out
    }

    pub fn encrypt_with_offset<let MAX_SUBSTRING_LENGTH: u32>(
        self,
        plaintext: BoundedVec<u8, MAX_SUBSTRING_LENGTH>,
        keystream_offset: u32,
    ) -> BoundedVec<u8, MAX_SUBSTRING_LENGTH> {
        let mut out: BoundedVec<u8, MAX_SUBSTRING_LENGTH> =
            BoundedVec::from_array([0; MAX_SUBSTRING_LENGTH]);
        // let initial_block_idx = keystream_offset / 64
        let initial_block_idx = keystream_offset >> 6; // 2^6 = 64

        // let initial_byte_idx = keystream_offset % 64;
        let initial_byte_idx = keystream_offset & 63;

        // let full_blocks_max = MAX_SUBSTRING_LENGTH / 64;
        let full_blocks_max = MAX_SUBSTRING_LENGTH >> 6;

        // This loop contains (full_blocks_max - 1) * BLOCK_SIZE = MAX_SUBSTRING_LENGTH - BLOCK_SIZE elements.
        for block_idx_plaintext in 1..full_blocks_max {
            let block_idx = block_idx_plaintext + initial_block_idx;
            let keystream = self.block(self.ctr + block_idx);
            let block_start = block_idx * BLOCK_SIZE;

            for byte_idx in 0..BLOCK_SIZE {
                let indice_plain = block_start + byte_idx - keystream_offset;
                out.set_unchecked(indice_plain, plaintext.get(indice_plain) ^ keystream[byte_idx]);
            }
        }

        let first_block_idx = initial_block_idx;
        let first_keystream = self.block(self.ctr + first_block_idx);

        let last_block_idx = full_blocks_max + initial_block_idx;
        let last_keystream = self.block(self.ctr + last_block_idx);
        let block_start = full_blocks_max * BLOCK_SIZE;

        for byte_idx in 0..BLOCK_SIZE {
            let indice_plain = block_start + byte_idx - initial_byte_idx;
            let indice = indice_plain % MAX_SUBSTRING_LENGTH;

            // let is_first_block = min(indice_plain / block_start, 1);
            let is_first_block = (indice_plain >= block_start) as u8;
            let keystream_byte_idx = is_first_block * first_keystream[byte_idx]
                + (1 - is_first_block) * last_keystream[byte_idx];

            out.set_unchecked(indice, plaintext.get(indice) ^ keystream_byte_idx);
        }

        out
    }

    pub fn decrypt<let MAX_CIRCUIT_LEN: u32>(
        self,
        ciphertext: BoundedVec<u8, MAX_CIRCUIT_LEN>,
    ) -> BoundedVec<u8, MAX_CIRCUIT_LEN> {
        self.encrypt(ciphertext)
    }

    fn block(self, ctr: u32) -> [u8; 64] {
        let mut state = self.state;
        state[12] = ctr;
        let mut working_state = state;

        for _ in 0..DOUBLE_ROUNDS {
            inner_block(&mut working_state);
        }
        for i in 0..STATE_SIZE {
            state[i] = utils::wrapping_add_32(state[i], working_state[i]);
        }

        serialize_state(&mut state)
    }
}

fn inner_block(state: &mut [u32; 16]) {
    // Column round.
    quarter_round(state, 0, 4, 8, 12);
    quarter_round(state, 1, 5, 9, 13);
    quarter_round(state, 2, 6, 10, 14);
    quarter_round(state, 3, 7, 11, 15);

    // Diagonal round.
    quarter_round(state, 0, 5, 10, 15);
    quarter_round(state, 1, 6, 11, 12);
    quarter_round(state, 2, 7, 8, 13);
    quarter_round(state, 3, 4, 9, 14);
}

fn quarter_round(state: &mut [u32; 16], a: u32, b: u32, c: u32, d: u32) {
    state[a] = utils::wrapping_add_32(state[a], state[b]);
    state[d] ^= state[a];
    state[d] = utils::rotl32(state[d], 16);

    state[c] = utils::wrapping_add_32(state[c], state[d]);
    state[b] ^= state[c];
    state[b] = utils::rotl32(state[b], 12);

    state[a] = utils::wrapping_add_32(state[a], state[b]);
    state[d] ^= state[a];
    state[d] = utils::rotl32(state[d], 8);

    state[c] = utils::wrapping_add_32(state[c], state[d]);
    state[b] ^= state[c];
    state[b] = utils::rotl32(state[b], 7);
}

fn serialize_state(state: &mut [u32; 16]) -> [u8; 64] {
    let mut serialized_state: [u8; 64] = [0; 64];

    for i in 0..16 {
        let bytes: [u8; 4] = (state[i] as Field).to_le_bytes();
        serialized_state[i * 4] = bytes[0];
        serialized_state[i * 4 + 1] = bytes[1];
        serialized_state[i * 4 + 2] = bytes[2];
        serialized_state[i * 4 + 3] = bytes[3];
    }

    serialized_state
}

/*
    Tests.
*/

#[test]
fn test_quarter_round() {
    let test_cases = get_quarter_round_test_cases();

    for case in test_cases {
        let mut state = case.initial_state;
        quarter_round(&mut state, case.a, case.b, case.c, case.d);
        assert_arrays_eq(state, case.expected_state);
    }
}

#[test]
fn test_block() {
    let test_cases = get_block_test_cases();

    for case in test_cases {
        run_block_test(case.key, case.counter, case.nonce, case.expected);
    }
}

