) -> BoundedVec<u8, MAX_LEN> {
    let chacha = ChaCha20::new(&mut key, ctr, &mut nonce);
    let plaintext = chacha.encrypt(plaintext);
    plaintext
}

fn generate_ciphertext_with_offset<let MAX_LEN: u32>(
    mut key: [u32; 8],
    ctr: u32,
    mut nonce: [u32; 3],
    plaintext: BoundedVec<u8, MAX_LEN>,
    keystream_offset: u32,
) -> BoundedVec<u8, MAX_LEN> {
    let chacha = ChaCha20::new(&mut key, ctr, &mut nonce);

    let plaintext = chacha.encrypt_with_offset(plaintext, keystream_offset);
    plaintext
}

